import React, {Component} from "react"; 

class Cards extends Component {
    render(){
        return (
        <div className="Cards">
            <h1>Title</h1>
            <p>Image</p>
            <p>Technologies used</p>
            <p>Brief description of project</p>
        </div>)
    }
}

export default Cards;
